import React from "react";
import "./Modal.css";

export default function Modal(props) {
  return (
    <div className="Modal">
      <h2>Change Profile Photo</h2>
      <input
        onChange={e => {
          this.setState({
            password: e.target.value
          });
        }}
        type="text"
        placeholder="Photo URL"
      />
    </div>
  );
}
